PSICQUIC Client (Standard)
A JAVA client is provided already by this project. If your project is using Maven 2,  you can start using the client right away just by adding this dependencies to your project.
Include the following dependency in your project:

Latest released version

      &lt;dependency&gt;
          &lt;groupId&gt;org.hupo.psi.mi.psicquic&lt;/groupId&gt;
          &lt;artifactId&gt;psicquic-client&lt;/artifactId&gt;
          &lt;version&gt;1.5.3&lt;/version&gt;
      &lt;/dependency&gt;

Current version under development

      &lt;dependency&gt;
          &lt;groupId&gt;org.hupo.psi.mi.psicquic&lt;/groupId&gt;
          &lt;artifactId&gt;psicquic-client&lt;/artifactId&gt;
          &lt;version&gt;1.5.4-SNAPSHOT&lt;/version&gt;
      &lt;/dependency&gt;
As of now, this dependency is hosted at the European Bioinformatics Institute (EBI) repository. You can add this repository in your pom.xml file like this:
    &lt;repositories&gt;
        &lt;repository&gt;
            &lt;id&gt;intact.nexus&lt;/id&gt;
            &lt;name&gt;IntAct Nexus&lt;/name&gt;
            &lt;url&gt;http://www.ebi.ac.uk/intact/maven/nexus/content/groups/public&lt;/url&gt;
        &lt;/repository&gt;
    &lt;/repositories&gt;
